package week1.day2;

public class FibonacciSeries {

	public static void main(String[] args) {
	
		// TODO Auto-generated method stub
		
		int num1=0,num2=1,num3;
		for(int i=0;i<=8;i++)
		{
			num3=num1+num2;
			System.out.println(num3);
			num1=num2;
			num2=num3;
					

	}
	}
}
